// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import {ERC20} from '../dependencies/openzeppelin/contracts/token/ERC20/ERC20.sol';
import {ArrayUtils} from './libraries/ArrayUtils.sol';
import {ExchangeCore} from './ExchangeCore.sol';
import {SaleKindInterface} from './libraries/SaleKindInterface.sol';
import {DataType} from './libraries/DataType.sol';
import {ExchangeCoreLogic} from './libraries/ExchangeCoreLogic.sol';


contract ExchangeHelper {

    string public constant version = "1.0";

    ExchangeCore public exchangeCore;

    constructor(ExchangeCore core) {
        exchangeCore = core;
    }

    /**
     * @dev Call guardedArrayReplace - library function exposed for testing.
     */
    function guardedArrayReplace(bytes memory array, bytes memory desired, bytes memory mask)
        public
        pure
        returns (bytes memory)
    {
        ArrayUtils.guardedArrayReplace(array, desired, mask);
        return array;
    }

    /**
     * @dev Call calculateFinalPrice - library function exposed for testing.
     */
    function calculateFinalPrice(SaleKindInterface.Side side, SaleKindInterface.SaleKind saleKind, uint basePrice, uint extra, uint listingTime, uint expirationTime)
        public
        view
        returns (uint)
    {
        return SaleKindInterface.calculateFinalPrice(side, saleKind, basePrice, extra, listingTime, expirationTime);
    }

    /**
     * @dev Call hashOrder - Solidity ABI encoding limitation workaround, hopefully temporary.
     */
    function hashOrder(DataType.Order memory order)
        public
        pure
        returns (bytes32)
    {
        return ExchangeCoreLogic.hashOrder(order);
    }

    /**
     * @dev Call hashToSign - Solidity ABI encoding limitation workaround, hopefully temporary.
     */
    function hashToSign(DataType.Order memory order)
        public
        pure
        returns (bytes32)
    { 
        return ExchangeCoreLogic.hashToSign(order);
    }

    /**
     * @dev Call validateOrderParameters - Solidity ABI encoding limitation workaround, hopefully temporary.
     */
    function validateOrderParameters(DataType.Order memory order)
        view
        public
        returns (bool)
    {   
        return ExchangeCoreLogic.validateOrderParameters(
          order, exchangeCore.minimumMakerProtocolFee(), exchangeCore.minimumTakerProtocolFee()
        );
    }

    /**
     * @dev Call validateOrder - Solidity ABI encoding limitation workaround, hopefully temporary.
     */
    function validateOrder(DataType.Order memory order, DataType.Sig memory sig)
        view
        public
        returns (bool)
    {
        return exchangeCore.validateOrder(ExchangeCoreLogic.hashToSign(order),order,sig);
    }

    /**
     * @dev Call approveOrder - Solidity ABI encoding limitation workaround, hopefully temporary.
     */
    function approveOrder(DataType.Order memory order, bool orderbookInclusionDesired) 
        public
    {
        return exchangeCore.approveOrder(order, orderbookInclusionDesired);
    }

    /**
     * @dev Call cancelOrder - Solidity ABI encoding limitation workaround, hopefully temporary.
     */
    function cancelOrder(DataType.Order memory order, DataType.Sig memory sig)
        public
    {
        return exchangeCore.cancelOrder(order, sig);
    }

    /**
     * @dev Call calculateCurrentPrice - Solidity ABI encoding limitation workaround, hopefully temporary.
     */
    function calculateCurrentPrice(DataType.Order memory order)
        public
        view
        returns (uint)
    {
        return ExchangeCoreLogic.calculateCurrentPrice(order);
    }

    /**
     * @dev Call ordersCanMatch - Solidity ABI encoding limitation workaround, hopefully temporary.
     */
    function ordersCanMatch(DataType.Order memory buy, DataType.Order memory sell)
        public
        view
        returns (bool)
    {
        return ExchangeCoreLogic.ordersCanMatch(buy,sell);
    }

    /**
